     * @param fallbackUser If the transaction fails send the escrowed funds to this address
     */
    function swapToUnits(
        uint32 chain,
        bytes32 targetPool,
        bytes32 targetUser,
        address fromAsset,
        uint8 toAssetIndex,
        uint256 amount,
        uint256 minOut,
        address fallbackUser
    ) internal returns (uint256) {
        // uint256 fee = mulX64(amount, _poolFeeX64);

        // Calculate the group specific units bought.
        uint256 U = dry_swap_to_unit(
            fromAsset,
            amount - mulX64(amount, _poolFeeX64)
        );

        // Create the escrow identifier
        // uint256 sourceSwapId = _escrowIterator % 2**(32);

        // Send the purchased units to targetPool on chain.
        CatalystIBCInterface(_chaininterface).crossChainSwap(
            chain,
            targetPool,
            targetUser,
            toAssetIndex,
            U,
            minOut,
            false,
            uint32(_escrowIterator % 2**(32))
        );

        // Collect the tokens from the user.
        IERC20(fromAsset).safeTransferFrom(msg.sender, address(this), amount);

        // Escrow the tokens
        _escrowedTokens[fromAsset] += amount;
        _escrowedFor[_escrowIterator % 2**(32)] = TokenEscrow({
            user: fallbackUser,
            amount: amount,
            token: fromAsset
        });

        // Track units for fee distribution.
        _unitTracker += int256(U); // Todo: security

        // Compute the change in max_unit_inflow.
        {
            uint256 fromBalance = ERC20(fromAsset).balanceOf(address(this));
            _max_unit_inflow += mulX64(
                _ampUnitCONSTANT,
                getModifyUnitCapacity(
                    fromBalance - (amount - mulX64(amount, _poolFeeX64)),
                    fromBalance,
                    fromAsset
                )
            );
        }

        // Incoming swaps should be subtracted from the unit flow.
        // It is assumed if the router was fraudulent, that no-one would execute a trade.
        // As a result, if people swap into the pool, we should expect that there is exactly
        // the inswapped amount of trust in the pool.
        // If this wasn't implemented, there would be a maximum daily cross chain volume,
        // which is bad for liquidity providers.
        {
            uint256 UF = _unit_flow;
            // If UF < U and we do UF - U < 0 underflow => bad.
            if (UF > U) {
                _unit_flow -= U;
            } else if (UF != 0) {
                // Save ~100 gas if UF = 0.
                _unit_flow = 0;
            }
        }

        emit SwapToUnits(
            targetPool,
            targetUser,
            fromAsset,
            toAssetIndex,
            amount,
            U,
            mulX64(amount, _poolFeeX64),
            uint32(_escrowIterator % 2**(32))
        );

        _escrowIterator += 1;

        return U;
    }

