    //--- Liquidity swapping ---//
    // Because of the wap pool tokens work in a group of pools, there
    // needs to be a way to manage an equilibrium between pool token
    // value and token pool value.

    /**
     * @notice Computes the integral \int_{A-out}^{A} W/w^k · (1-k) dw
     *    = - W · ( A^(1-k) - (A - _out)^(1-k) )
     * For optimisations, U is always assumed to be negative for liquidity units.
     * Thus the function computes:  W · ( A^(1-k) - (A - _out)^(1-k) )
     * The value is returned as negative liquidity units, which is always in X64.
     * @dev
     * All input amounts should be the raw numbers and not X64.
     * Since units are always denominated in X64, the function
     * should be treated as mathematically *native*.
     * @param input The input amount.
     * @param A The current pool balance0.
     * @param W The pool weight of the token.
     * @param amp The amplification
     * @return uint256 Group specific liquidity units in X64 (units are **always** X64).
     */
    function compute_liquidity(
        uint256 input,
        uint256 A,
        uint256 W,
        uint256 amp
    ) internal pure returns (uint256) {
        uint256 oneMinusAmp = ONE - amp; // Minor gas saving :)
        return
            W *
            (fpowX64(A << 64, oneMinusAmp) -
                fpowX64((A - input) << 64, oneMinusAmp));
    }

    /**
     * @notice Solves the equation U = \int_{A}^{A+_out} W/w^k · (1-k) dw for _out
     *     = B ·
     *     (
     *         (
     *             (W_B · B^(1-k) - U) / (W_B · B^(1-k))
     *         )^(1/(1-k)) - 1
     *     )
     * Since _U is negative units, the function actually computes:
     *  B · (
     *          (
     *              (W_B · B^(1-k) + U) / (W_B · B^(1-k))
     *          )^(1/(1-k)) - 1
     *      )
     * Note that the specific weight divides into the equation such that the is substrationally simplified.
     *
     * The value is returned as output pool token.
     * @dev All input amounts should be the raw numbers and not X64.
     * Since units are always denominated in X64, the function
     * should be treated as mathematically *native*.
     * @param U Input negative liquidity units. Is technically X64 but can be treated as not.
     * @param B The current pool balance0 of the _out token.
     * @param WSUM The pool weight of the _out token.
     * @param amp The amplification
     * @return uint256 Output denominated in output pool token.
     */
    function solve_liquidity(
        uint256 U,
        uint256 B,
        uint256 WSUM,
        uint256 amp
    ) internal pure returns (uint256) {
        return
            (B *
                (fpowX64(bigdiv64(WSUM + U, WSUM), bigdiv64(ONE, ONE - amp)) -
                    ONE)) >> 64;
    }

    /**
     * @notice Computes the return of a liquidity swap from liquidity into units, without executing one.
     * @param from The address of the liquidity to sell.
     * @param amountX64 The amount of _from liquidity to sell.
     * @return uint256 Liquidity units in X64 (units are **always** X64).
     */
    function dry_liquidity_to_unit(address from, uint256 amountX64)
        public
        view
        returns (uint256)
    {
        uint256 A = _balance0[from];
        uint256 W = _weight[from];
        require(A < 2**(256 - 64) - 1); // dev: Potential exploitable
        // if the attacker can abuse
        // some kind of flash-mint.
        return compute_liquidity(amountX64, A, W, _amp);
    }

    /**
     * @notice Computes the output of a liquidity swap from units into liquidity, without executing one.
     * @param to The token address of the target balance0.
     * @param U The number of units used to buy liquidity of _to.
     * @return Output denominated in balance0s.
     */
    function dry_liquidity_from_unit(
        address to,
        uint256 U,
        uint256 WSUM
    ) public view returns (uint256) {
        uint256 B = _balance0[to];

        return solve_liquidity(U, B, WSUM, _amp);
    }

    function distributeFees() public returns (uint256) {
        uint256 WSUM = 0; // is X64
        address[] memory tokens = new address[](NUMASSETS);
        uint256 amp = _amp;
        int256 calculatedOutstandingUnits = 0;

        uint256 it = 0;
        for (; it < NUMASSETS; it++) {
            address token = _tokenIndexing[it];
            if (token == address(0)) break;

            uint256 b0 = _balance0[token];
            uint256 bt = IERC20(token).balanceOf(address(this));
            uint256 w = _weight[token];
            if (bt > b0) {
                calculatedOutstandingUnits += int256(
                    compute_liquidity(bt - b0, b0, w, amp)
                ); //TODO : Security
            } else {
                // b0 > bt
                calculatedOutstandingUnits -= int256(
                    compute_liquidity(b0 - bt, bt, w, amp)
                );
            }
            tokens[it] = token;
            WSUM += w * fpowX64(b0, ONE - amp);
        }

        calculatedOutstandingUnits = _unitTracker - calculatedOutstandingUnits;
        // Because of the balance0 constraint of wrapped pool tokens,
        // only the first balance0 change needs to be computed.
        uint256 token0B0 = dry_liquidity_from_unit(
            tokens[0],
            uint256(calculatedOutstandingUnits),
            WSUM
        );

        uint256 ts = totalSupply();
        // Token0B0 * _baseAmount = _balance0
        uint256 poolTokens = (token0B0 * ts) / _balance0[tokens[0]];
        _balance0[tokens[0]] += token0B0;

        for (uint256 it_ = 0; it_ < it; it_++) {
            _balance0[tokens[it_]] += (_balance0[tokens[it_]] * poolTokens);
        }

        return poolTokens;
    }

    // @nonreentrant('lock')
    /**
     * @notice Initiate a cross-chain liquidity swap by lowering liquidity and transfer the liquidity units to another pool.
     * @param chain The target chain. Will be converted by the interface to channelId.
     * @param targetPool The target pool on the target chain encoded in bytes32. For EVM chains this can be computed as:
     * Vyper: convert(_poolAddress, bytes32)
     * Solidity: abi.encode(_poolAddress)
     * Brownie: brownie.convert.to_bytes(_poolAddress, type_str="bytes32")
     * @param targetUser The recipient of the transaction on _chain. Encoded in bytes32. For EVM chains it can be found similarly to _targetPool.
     * @param baseAmount The number of pool tokens to liquidity Swap
     */
    function outLiquidity(
        uint256 chain,
        bytes32 targetPool,
        bytes32 targetUser,
        uint256 baseAmount
    ) external returns (uint256) {
        // Cache totalSupply. This saves up to ~200 gas.
        uint256 initial_totalSupply = totalSupply();

        // Since we have already cached totalSupply, we might as well burn the tokens
        // now. If the user doesn't have enough tokens, they save a bit of gas.
        _burn(msg.sender, baseAmount);

        // The number of units corresponding gained by lowering baseAmount liquidity
        // Should be found. This will be done by looping over each conversion.
        uint256 U = 0;
        for (uint256 it = 0; it < NUMASSETS; it++) {
            address token = _tokenIndexing[it];
            if (token == address(0)) break;

            // The pool ownership given up, converted to balance0s (given up)
            uint256 pt_Token = (_balance0[token] * baseAmount) /
                initial_totalSupply;
            // Swapping to units.
            U += dry_liquidity_to_unit(token, pt_Token);
            // Subtracting the swapped units.
            _balance0[token] -= pt_Token;
        }

        // Sending the liquidity units over.
        CatalystIBCInterface(_chaininterface).liquiditySwap(
            chain,
            targetPool,
            targetUser,
            U,
            msg.sender
        );

        // Correcting the routing security limit. (To increase maximum daily volume)
        uint256 LUF = _liquidity_flow;
        if (LUF > baseAmount) {
            _liquidity_flow -= baseAmount;
        } else if (LUF != 0) {
            _liquidity_flow = 0;
        }
        // The SwapToUnits event is reused.  # TODO: Separate event?
        emit SwapToUnits(
            targetPool,
            targetUser,
            address(this),
            2**8 - 1,
            baseAmount,
            U,
            0,
            0
        ); // TODO: sourceSwapId;

        return U;
    }

    // @nonreentrant('lock')
    /**
     * @notice Completes a cross-chain swap by converting liquidity units to pool tokens
     * Called exclusively by the chaininterface.
     * @dev Can only be called by the chaininterface, as there is no way
     * to check the validity of units.
     * @param who The recipient of pool tokens
     * @param U Number of units to convert into pool tokens.
     */
    function inLiquidity(address who, uint256 U) external returns (uint256) {
        // The chaininterface is the only valid caller of this function, as there cannot
        // be a check of _U. (It is purely a number)
        require(msg.sender == _chaininterface);

        // The units should be distributed in such a way that the balance0
        // ratio is the same before and after the swap. Since the weights depends
        // on the current pool token balance, it cannot be cached.
        uint256 WSUM = 0; // is X64.
        address[] memory tokens = new address[](NUMASSETS);
        uint256 oneMinusAmp = ONE - _amp;

        uint256 it = 0;
        for (; it < NUMASSETS; it++) {
            address token = _tokenIndexing[it];
            if (token == address(0)) break;

            tokens[it] = token;

            WSUM +=
                _weight[token] *
                fpowX64(_balance0[token] << 64, oneMinusAmp);
        }

        address token0 = _tokenIndexing[0];
        // Because of the balance0 constraint of wrapped pool tokens,
        // only the first balance0 change needs to be computed.
        uint256 token0B0 = dry_liquidity_from_unit(token0, U, WSUM);

        uint256 ts = totalSupply();
        // Token0B0 * _baseAmount = self.balance0
        // To increase the resolution, the balance0s are converted into pool tokens.
        // Since 2**64 is the reference liquidity and 2**64 is a lot larger than most token
        // amounts, it is assumed that it provides a better resolution. (for loop)
        uint256 poolTokens = (token0B0 * ts) / _balance0[token0];
        _balance0[token0] += token0B0;

        for (uint256 i = 1; i < it; i++) {
            address token = tokens[i];
            // The pool token is used as reference, since it providers a higher resolution
            // than the balance0 constraint.
            _balance0[token] += (_balance0[token] * poolTokens) / ts;
            // Alternative based on balance0 constraint  <- Lower resolution
            // _balance0[token] += (token0B0*_balance0[token])/_balance0[token0]
        }

        // Check if the swap honors the security limit.
        checkAndSetLiquidityCapacity(poolTokens);

        // Mint pool tokens for _who
        _mint(who, poolTokens);

        // The SwapToUnits event is reused.  # TODO: Separate event?
        emit SwapFromUnits(who, address(this), U, poolTokens);

        return poolTokens;
    }
}
